import React from "react";
import { Progress, Segment } from "semantic-ui-react";
import { generateRandomKPI } from "../../../utils/generateRandomNumber";

const KPIs = [
  {
    title: "Large Food Order served:",
    color: "red",
    progress: generateRandomKPI(),
  },
  {
    title: "Large Food Order served:",
    color: "green",
    progress: generateRandomKPI(),
  },
];
const Achievement = () => {
  return (
    <div>
      This is achiecemtent
      {/* <div>340/351 wins</div>
      <Progress percent={32} inverted color="red" progress style={{margin:0, padding:0}}/>
      <Progress percent={59} inverted color="orange" progress style={{margin:0, padding:0}}/>
      <Progress percent={13} inverted color="yellow" progress />
      Large Food Order served:
      <Progress value='3' total='5' progress='ratio' color='red'/> */}
      {KPIs.map(({ title, color, progress }) => {
        return (
          <div>
            {title}
            <Progress
              value={progress.completed.toString()}
              total={progress.total.toString()}
              progress="ratio"
              color={color}
            />
          </div>
        );
      })}
    </div>
  );
};

export default Achievement;
